import React from "react";

import "./Footer.css";

const Footer = () => {
  return (
    <div class="container">
      <footer class="py-3 my-4">
        <p className="footer">&copy; Created by Developer Gisell Mata</p>
      </footer>
    </div>
  );
};

export default Footer;
